import React from 'react';
import styled from 'styled-components';
import { FaMapMarkerAlt, FaClock, FaGraduationCap, FaCalendarAlt } from 'react-icons/fa';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';

// Image imports
import logo from './assets/logo.png';
import doctorImage from './assets/doctor.jpg';
import doctorProfile from './assets/medical.png';
import mapImage from './assets/map.jpg';
import calendarImage from './assets/may-calendar.png';
import stethoscopeImage from './assets/stethoscope.png';
import patientImage from './assets/patient.png';

// Service images
import backPain from './assets/back-pain.jpg';
import wristPain from './assets/wrist-joint-pain.jpg';
import slippedDisc from './assets/slipped-disc.jpg';
import neckPain from './assets/neck-pain.jpg';
import anklePain from './assets/ankle-joint-pain.png';
import headache from './assets/headache.jpg';
import kneePain from './assets/knee-pain.jpg';
import sportInjuries from './assets/sport-injuries.jpg';

// Google Maps configuration
const mapContainerStyle = {
  width: '100%',
  height: '400px',
  borderRadius: '8px'
};

const center = {
  lat: 19.0760,  // Mumbai coordinates
  lng: 72.8777
};

const App = () => {
  // Services data with imported images
  const servicesData = [
    { id: 1, img: backPain, title: 'Back Pain Treatment' },
    { id: 2, img: wristPain, title: 'Joint Pain Treatment' },
    { id: 3, img: slippedDisc, title: 'Slipped Disc Treatment' },
    { id: 4, img: neckPain, title: 'Neck Pain Treatment' },
    { id: 5, img: anklePain, title: 'Joint Pain Treatment' },
    { id: 6, img: headache, title: 'Headache Treatment' },
    { id: 7, img: kneePain, title: 'Knee Pain Treatment' },
    { id: 8, img: sportInjuries, title: 'Sports Injuries Treatment' }
  ];

  // Patient resources data
  const resourcesData = [
    { 
      id: 1, 
      type: 'testimonial',
      img: patientImage,
      content: '"Dr. Rajeev Menon is truly a great doctor. He has lots of experience and his approach is very friendly."',
      author: '- Priya Mehta',
      buttonText: 'Read More'
    },
    { 
      id: 2, 
      type: 'faq',
      title: 'Frequently Asked Questions',
      items: [
        'How can I get my prescription?',
        'What should I bring to my appointment?',
        'What should I expect during my first checkup?'
      ],
      buttonText: 'View all'
    },
    { 
      id: 3, 
      type: 'calendar',
      title: 'Schedule an Appointment',
      img: calendarImage,
      icon: <FaCalendarAlt size={24} />
    },
    { 
      id: 4, 
      type: 'blog',
      title: 'Blog',
      img: stethoscopeImage,
      content: 'Understanding Chronic Pain',
      buttonText: 'Read more'
    }
  ];

  return (
    <GlobalStyles>
      <div className="App">
        {/* ... (keep all your existing header, hero, doctor, and services sections exactly the same) ... */}

        {/* Updated Map Section */}
        <FormSection>
          <ContactForm>
            <FormTitle>Contact Us</FormTitle>
            <FormInput type="text" placeholder="Name" />
            <FormInput type="email" placeholder="Email" />
            <FormInput type="tel" placeholder="Phone" />
            <FormTextarea placeholder="Your Message"></FormTextarea>
            <PrimaryButton>Send Message</PrimaryButton>
          </ContactForm>

          <AppointmentForm>
            <FormTitle>Book Appointment</FormTitle>
            <FormInput type="date" />
            <FormInput type="time" />
            <FormInput type="text" placeholder="Reason for Visit" />
            <PrimaryButton>Book Now</PrimaryButton>
          </AppointmentForm>

          <MapContainer>
            <FormTitle>
              <FaMapMarkerAlt /> Clinic Location
            </FormTitle>

            {/* Replace the static map image with interactive Google Map */}
            <LoadScript googleMapsApiKey="YOUR_GOOGLE_MAPS_API_KEY">
              <GoogleMap
                mapContainerStyle={mapContainerStyle}
                center={center}
                zoom={15}
                options={{
                  streetViewControl: false,
                  mapTypeControl: false,
                  fullscreenControl: false
                }}
              >
                <Marker 
                  position={center} 
                  icon={{
                    url: 'https://maps.google.com/mapfiles/ms/icons/red-dot.png'
                  }}
                />
              </GoogleMap>
            </LoadScript>

            <MapAddress>
              <strong>Address:</strong> 123 Healing Street, Health District, Mumbai 400001
            </MapAddress>

            <MapZoomControl>
              <label>How to reach us:</label>
              <p style={{ color: '#555', fontSize: '0.9rem', marginTop: '0.5rem' }}>
                Nearest Metro: Health City Station (200m)<br />
                Parking available at clinic premises
              </p>
            </MapZoomControl>
          </MapContainer>
        </FormSection>

        {/* ... (keep all your existing footer code exactly the same) ... */}
      </div>
    </GlobalStyles>
  );
};

// ... (keep all your existing styled components exactly the same) ...

export default App;
